import React from 'react';
import Person from './Person/Person'
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Hello React!</h1>
      <Person name = "Jerry"/>
      <Person name = "Lucy"/>
      <Person name = "Alex">This is content.</Person>
    </div>
  );
}

export default App;
